import React from 'react'
import { BrowserRouter, Routes, Route} from 'react-router-dom';
import Home from './Pages/Home';
import Docs from './Pages/Docs';

 function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route path='/' element={<Home/>} />
      <Route path='/Docs' element={<Docs/>} />
    </Routes>
    </BrowserRouter>
  )
}

export default App;
